import React from 'react'
import DogBar from '../components/DogBar.js'

function Filter(dogs) {
    return (
        <>
            <div id="filter-div">
                <button id="good-dog-filter">Filter good dogs: OFF</button>
            </div>
            <DogBar dogs={props.dogs}/>
        </>
    )
}

export default Filter
